import './App.css';


function Welcome(props){
  return(<h1>Welcome, {props.name}</h1>);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Welcome name="Test"></Welcome>

        <p>

          Edit <code>src/App.js</code> and save to reload.

        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="Body">
        <p>
          text
        </p>
      </body>
    </div>
  );
}



export default App;
